import React from "react";
import Logo from "../img/Logo.png";

// Flex (List)
// Grid (WPF)

function Search() {
  return (
    <div style={{ backgroundColor: "yellow" }}>
      <div style={{ display: "flex" }}>
        <img
          src={Logo}
          style={{ backgroundColor: "red", width: "400px", height: "150px" }}
        />
        <input style={{ width: "600px", height: "52px" }} />
      </div>
      <div style={{ backgroundColor: "green" }}>
        <img
          src={Logo}
          style={{ backgroundColor: "red", width: "400px", height: "150px" }}
        />
        <input style={{ width: "600px", height: "52px" }} />
      </div>
    </div>
